import './model.dart';

class Machine extends Model {
  static String table = 'machine_list';

  int id;
  String name;
  String pic;
  String compression;
  String password;
  String encryption;
  int port;
  String cmd;
  String ip;

  Machine(
      {this.id,
      this.name = '',
      this.pic = '',
      this.compression = '',
      this.password = '',
      this.encryption = '',
      this.port = 3000,
      this.cmd = '',
      this.ip = '127.0.0.1'});

  Map<String, dynamic> toMap() {
    Map<String, dynamic> map = {
      'name': name,
      'pic':
          '',
      'compression': compression,
      'password': password,
      'encryption': encryption,
      'port': port,
      'cmd': cmd,
      'ip': ip
    };

    if (id != null) {
      map['id'] = id;
    }

    return map;
  }

  static Machine fromMap(Map<String, dynamic> map) {
    return Machine(
        id: map['id'],
        pic: map['pic'],
        name: map['name'],
        compression: map['compression'],
        password: map['password'],
        encryption: map['encryption'],
        port: map['port'],
        cmd: map['cmd'],
        ip: map['ip']);
  }
}
